Thursday March 05, 2009

HR 1: News, commentary
HR 2: News, Dr. Paul Craig Roberts, open lines
HR 3: Open lines, Marcus Williams, open lines w/Williams
HR 4: Marcus Williams, Rebecca Carley, M.D. - pharma and eugenics

Alex talks about the vaccines contaminated with the deadly avian flu virus which were distributed to 18 countries by the American company Baxter. He welcomes back to the show economist and a nationally syndicated columnist Paul Craig Roberts, the former Assistant Secretary of the Treasury in the Reagan administration. Alex also welcomes to the show Marcus Williams, owner of the Nubian Bookstore in Morrow, Georgia, who shot footage of Prof. Griff from Public Enemy that appears in Alex's latest film, The Obama Deception. Alex also talks with Rebecca Carley, M.D., author of an article entitled Inoculations - The True Weapons Of Mass Destruction Causing VIDS (Vaccine Induced Diseases) An Epidemic Of Genocide.


